const Buttons = () => {

    return (
        <>
        <header className="buttons">
            <div className="container mx-auto px-[16px]">
                <a 
                    class="button bg-[#B7B1F2] justify-center mx-auto md:inline-flex flex py-[24px] px-[70px] rounded-[62px] xl:my-[50px] my-[30px]" href="#" data-aos="fade-up" data-aos-duration="800" data-aos-delay="300">Send
                </a>
            </div>
        </header>
        </>
    )
}
export default Buttons;
